const displayReducer = (state = ['display', 'mainMenu'], action) => {
  switch (action.type) {
    case 'SET_DISPLAY':
      console.log(action.payload);
      let className;

      state.forEach((item) => {
        console.log(item);
      });
      return;
    default:
      return state;
  }
};

export default displayReducer;
